  // 1 -> v > x + th
  // 2 -> v < x - th
  // 0 -> x - th <= v <= x + th
  __device__ __forceinline__ int diffType(const int v, const int x, const int th)
  {
    const int diff = x - v;

    return static_cast<int>(diff < -th) + (static_cast<int>(diff > th) << 1);
  }

  __device__ void calcMask(const uint C[4], const int v, const int th, int& mask1, int& mask2)
  {
    mask1 = 0;
    mask2 = 0;

    int d1, d2;



    d1 = diffType(v, C[0] & 0xff, th);
    d2 = diffType(v, C[2] & 0xff, th);

    if ((d1 | d2) == 0)
      return;

    mask1 |= (d1 & 1) << 0;
    mask2 |= ((d1 & 2) >> 1) << 0;

    mask1 |= (d2 & 1) << 8;
    mask2 |= ((d2 & 2) >> 1) << 8;



    d1 = diffType(v, C[1] & 0xff, th);
    d2 = diffType(v, C[3] & 0xff, th);

    if ((d1 | d2) == 0)
      return;

    mask1 |= (d1 & 1) << 4;
    mask2 |= ((d1 & 2) >> 1) << 4;

    mask1 |= (d2 & 1) << 12;
    mask2 |= ((d2 & 2) >> 1) << 12;



    d1 = diffType(v, (C[0] >> (2 * 8)) & 0xff, th);
    d2 = diffType(v, (C[2] >> (2 * 8)) & 0xff, th);

    if ((d1 | d2) == 0)
      return;

    mask1 |= (d1 & 1) << 2;
    mask2 |= ((d1 & 2) >> 1) << 2;

    mask1 |= (d2 & 1) << 10;
    mask2 |= ((d2 & 2) >> 1) << 10;



    d1 = diffType(v, (C[1] >> (2 * 8)) & 0xff, th);
    d2 = diffType(v, (C[3] >> (2 * 8)) & 0xff, th);

    if ((d1 | d2) == 0)
      return;

    mask1 |= (d1 & 1) << 6;
    mask2 |= ((d1 & 2) >> 1) << 6;

    mask1 |= (d2 & 1) << 14;
    mask2 |= ((d2 & 2) >> 1) << 14;



    d1 = diffType(v, (C[0] >> (1 * 8)) & 0xff, th);
    d2 = diffType(v, (C[2] >> (1 * 8)) & 0xff, th);

    /*if ((d1 | d2) == 0)
      return;*/

    mask1 |= (d1 & 1) << 1;
    mask2 |= ((d1 & 2) >> 1) << 1;

    mask1 |= (d2 & 1) << 9;
    mask2 |= ((d2 & 2) >> 1) << 9;



    d1 = diffType(v, (C[0] >> (3 * 8)) & 0xff, th);
    d2 = diffType(v, (C[2] >> (3 * 8)) & 0xff, th);

    /*if ((d1 | d2) == 0)
      return;*/

    mask1 |= (d1 & 1) << 3;
    mask2 |= ((d1 & 2) >> 1) << 3;

    mask1 |= (d2 & 1) << 11;
    mask2 |= ((d2 & 2) >> 1) << 11;



    d1 = diffType(v, (C[1] >> (1 * 8)) & 0xff, th);
    d2 = diffType(v, (C[3] >> (1 * 8)) & 0xff, th);

    /*if ((d1 | d2) == 0)
      return;*/

    mask1 |= (d1 & 1) << 5;
    mask2 |= ((d1 & 2) >> 1) << 5;

    mask1 |= (d2 & 1) << 13;
    mask2 |= ((d2 & 2) >> 1) << 13;



    d1 = diffType(v, (C[1] >> (3 * 8)) & 0xff, th);
    d2 = diffType(v, (C[3] >> (3 * 8)) & 0xff, th);

    mask1 |= (d1 & 1) << 7;
    mask2 |= ((d1 & 2) >> 1) << 7;

    mask1 |= (d2 & 1) << 15;
    mask2 |= ((d2 & 2) >> 1) << 15;
  }

  // 1 -> v > x + th
  // 2 -> v < x - th
  // 0 -> not a keypoint
  __device__ __forceinline__ bool isKeyPoint(int mask1, int mask2)
  {
    return (__popc(mask1) > 8 && (c_table[(mask1 >> 3) - 63] & (1 << (mask1 & 7)))) ||
      (__popc(mask2) > 8 && (c_table[(mask2 >> 3) - 63] & (1 << (mask2 & 7))));
  }

  __device__ int cornerScore(const uint C[4], const int v, const int threshold)
  {
    // binary search in [threshold + 1, 255]

    int min = threshold + 1;
    int max = 255;

    while (min <= max)
    {
      const int mid = (min + max) >> 1;

      int mask1 = 0;
      int mask2 = 0;

      calcMask(C, v, mid, mask1, mask2);

      int isKp = static_cast<int>(isKeyPoint(mask1, mask2));

      min = isKp * (mid + 1) + (isKp ^ 1) * min;
      max = (isKp ^ 1) * (mid - 1) + isKp * max;
    }

    return min - 1;
  }

  __device__ bool isKeyPoint2(const PtrStepSzb img, const int i, const int j, const int threshold, PtrStepi scoreMat) {
    int v;
    uint C[4] = {0,0,0,0};

    C[2] |= static_cast<uint>(img(i - 3, j - 1)) << 8;
    C[2] |= static_cast<uint>(img(i - 3, j));
    C[1] |= static_cast<uint>(img(i - 3, j + 1)) << (3 * 8);

    C[2] |= static_cast<uint>(img(i - 2, j - 2)) << (2 * 8);
    C[1] |= static_cast<uint>(img(i - 2, j + 2)) << (2 * 8);

    C[2] |= static_cast<uint>(img(i - 1, j - 3)) << (3 * 8);
    C[1] |= static_cast<uint>(img(i - 1, j + 3)) << 8;

    C[3] |= static_cast<uint>(img(i, j - 3));
    v     = static_cast<int>(img(i, j));
    C[1] |= static_cast<uint>(img(i, j + 3));

    int d1 = diffType(v, C[1] & 0xff, threshold);
    int d2 = diffType(v, C[3] & 0xff, threshold);

    if ((d1 | d2) == 0) {
      return false;
    }
    C[3] |= static_cast<uint>(img(i + 1, j - 3)) << 8;
    C[0] |= static_cast<uint>(img(i + 1, j + 3)) << (3 * 8);

    C[3] |= static_cast<uint>(img(i + 2, j - 2)) << (2 * 8);
    C[0] |= static_cast<uint>(img(i + 2, j + 2)) << (2 * 8);

    C[3] |= static_cast<uint>(img(i + 3, j - 1)) << (3 * 8);
    C[0] |= static_cast<uint>(img(i + 3, j));
    C[0] |= static_cast<uint>(img(i + 3, j + 1)) << 8;

    int mask1 = 0;
    int mask2 = 0;

    calcMask(C, v, threshold, mask1, mask2);
    if (isKeyPoint(mask1, mask2)) {
      scoreMat(i, j) = cornerScore(C, v, threshold);
      return true;
    } else {
      return false;
    }
  }

  __device__ bool isMax(short2 loc, PtrStepi scoreMat) {
    int score = scoreMat(loc.y, loc.x);
    bool ismax =
      score > scoreMat(loc.y - 1, loc.x - 1) &&
      score > scoreMat(loc.y - 1, loc.x    ) &&
      score > scoreMat(loc.y - 1, loc.x + 1) &&

      score > scoreMat(loc.y    , loc.x - 1) &&
      score > scoreMat(loc.y    , loc.x + 1) &&

      score > scoreMat(loc.y + 1, loc.x - 1) &&
      score > scoreMat(loc.y + 1, loc.x    ) &&
      score > scoreMat(loc.y + 1, loc.x + 1);
    return ismax;
  }

  __global__ void tileCalcKeypoints_kernel(const PtrStepSzb img, short2 * kpLoc, float * kpScore, const unsigned int maxKeypoints, int threshold, PtrStepi scoreMat, int borderX, int borderY, unsigned int * counter_ptr) {
    const int j = threadIdx.x + blockIdx.x * blockDim.x; // X
    const int i = (threadIdx.y + blockIdx.y * blockDim.y) * 4; // Y

    bool isKp[4] = {0};
    for (int t = 0; t < 4; ++t) {
      const int y_offset = t;
      if ((i+y_offset) < (img.rows - borderY) && j < (img.cols - borderX) && j >  borderX && (i +y_offset)  > borderY) {
        isKp[t] = isKeyPoint2(img, i+y_offset, j, threshold, scoreMat);
        if(isKp[t]){
          const unsigned int ind = atomicInc(counter_ptr, (unsigned int)(-1));
          short2 loc = make_short2(j, i+y_offset);
          kpLoc[ind] = loc;
        }
      }
    }

  }

  __global__ void nonmaxSuppression(const short2* kpLoc, int count, const PtrStepSzi scoreMat, short2* locFinal, float* response, unsigned int* d_counter)
  {
      const int kpIdx = threadIdx.x + blockIdx.x * blockDim.x;

      if (kpIdx < count)
      {
          short2 loc = kpLoc[kpIdx];

          int score = scoreMat(loc.y, loc.x);

          bool ismax =
              score > scoreMat(loc.y - 1, loc.x - 1) &&
              score > scoreMat(loc.y - 1, loc.x    ) &&
              score > scoreMat(loc.y - 1, loc.x + 1) &&

              score > scoreMat(loc.y    , loc.x - 1) &&
              score > scoreMat(loc.y    , loc.x + 1) &&

              score > scoreMat(loc.y + 1, loc.x - 1) &&
              score > scoreMat(loc.y + 1, loc.x    ) &&
              score > scoreMat(loc.y + 1, loc.x + 1);
          if (ismax)
          {
              const unsigned int ind = atomicInc(d_counter, (unsigned int)(-1));
              locFinal[ind] = loc;
              response[ind] = static_cast<float>(score);
          }
      }
  }

  int nonmaxSuppression_gpu(const short2* kpLoc, int count, PtrStepSzi score, short2* locFinal, float* responseFinal, unsigned int* d_counter, cudaStream_t stream)
  {
      dim3 block(256);
      dim3 grid;
      grid.x = divUp(count, block.x);
      unsigned int new_count;


      checkCudaErrors( cudaMemset(d_counter, 0, sizeof(unsigned int)) );
      nonmaxSuppression<<<grid, block, 0, stream>>>(kpLoc, count, score, locFinal, responseFinal, d_counter);

      checkCudaErrors( cudaGetLastError() );
      checkCudaErrors( cudaStreamSynchronize(stream) );

      checkCudaErrors( cudaMemcpy(&new_count, d_counter, sizeof(unsigned int), cudaMemcpyDeviceToHost) );

      return new_count;
  }

  GpuFast::GpuFast(int imHeight, int imWidth, int maxKeypoints)
    : imHeight(imHeight),imWidth(imWidth),  maxKeypoints(maxKeypoints)
  {
    checkCudaErrors( cudaStreamCreate(&stream) );
    checkCudaErrors( cudaMallocManaged(&kpLoc, sizeof(short2) * maxKeypoints) );
    checkCudaErrors( cudaMallocManaged(&kpLocFinal, sizeof(short2) * maxKeypoints) );
    checkCudaErrors( cudaMallocManaged(&kpScore, sizeof(float) * maxKeypoints) );
    checkCudaErrors( cudaMallocManaged(&kpResponseFinal, sizeof(float) * maxKeypoints) );
    checkCudaErrors( cudaStreamAttachMemAsync(stream, kpLoc) );
    checkCudaErrors( cudaStreamAttachMemAsync(stream, kpScore) );
    checkCudaErrors( cudaMalloc(&counter_ptr, sizeof(unsigned int)) );
    scoreMat = GpuMat(imHeight,imWidth , CV_32SC1);
  }

  GpuFast::~GpuFast() {
    checkCudaErrors( cudaFree(counter_ptr) );
    checkCudaErrors( cudaFree(kpScore) );
    checkCudaErrors( cudaFree(kpLocFinal) );
    checkCudaErrors( cudaFree(kpLoc) );
    checkCudaErrors( cudaFree(kpResponseFinal) );
    checkCudaErrors( cudaStreamDestroy(stream) );
    scoreMat.~GpuMat(); 
  }

  void GpuFast::detect(const cv::cuda::GpuMat image, int threshold, int borderX, int borderY, std::vector<KeyPoint>& keypoints) {
    checkCudaErrors(cudaMemsetAsync(scoreMat.ptr(), 0, scoreMat.step*scoreMat.rows, stream));
    checkCudaErrors(cudaMemsetAsync(counter_ptr, 0, sizeof(unsigned int), stream) );

    // Y component will be scaled by a factor of 4 in kernel so 8 is effectively 32
    dim3 dimBlock(128, 8); // Grid size
    dim3 dimGrid(divUp(image.cols, dimBlock.x), divUp(image.rows, dimBlock.y));
    checkCudaErrors( cudaStreamSynchronize(stream) );
    tileCalcKeypoints_kernel<<<dimGrid, dimBlock, 0, stream>>>(image, kpLoc, kpScore, maxKeypoints, threshold, scoreMat, borderX, borderY, counter_ptr);
    checkCudaErrors( cudaGetLastError() );
    checkCudaErrors( cudaStreamSynchronize(stream) );
    checkCudaErrors( cudaMemcpy(&count, counter_ptr, sizeof(unsigned int), cudaMemcpyDeviceToHost) );
    count = std::min(count, maxKeypoints);

    if(count == 0)
        return;

    count = nonmaxSuppression_gpu(kpLoc, count, scoreMat, kpLocFinal, kpResponseFinal, counter_ptr, stream);
    count = std::min(count, maxKeypoints);

    keypoints.resize(count);
    for (int i = 0; i < count; ++i) {
      keypoints[i] = cv::KeyPoint(kpLocFinal[i].x, kpLocFinal[i].y, -1, -1, kpResponseFinal[i]);
    }
  }

